INSERT INTO `v1_1dafa53cc6a20fee857dff813f6ed1a8ee08c18a93cbbf5e2eb05aed29cbeac8` VALUES ("", 3, 1, 60004, "今日の運勢は中吉！　歌を口ずさみ、幸運を呼び込もう！\n幸運になれるかは分からないけど……一緒に、歌いましょ？", 0, 0, 0, "", 0, 2, 562);
